import React from "react";

function Help() {
  return (
    <div class="p-5 text-center bg-body-tertiary">
      <div class="container py-5">
        <h1 class="text-body-emphasis">Help</h1>
        <p class="col-lg-8 mx-auto lead">
          If you need any assistance or have any questions, we're here to help!
        </p>
        <p class="col-lg-8 mx-auto lead">
          Feel free to reach out to our support team at support@example.com or
          call us at 123-456-7890.
        </p>
      </div>
    </div>
  )
}

export default Help;
